

-- DB Anlegen und verwenden
USE `e-Mensa`;

-- DDL = Tabellen definieren
-- DML = Tabellen manipulieren (bearbeiten)


-- beim Ausführen werden definierte Tabellen gelöscht --> einfacheres Testen (Reihenfolge genau umgekehrt)
		DROP TABLE IF EXISTS befreundetMit;
		DROP TABLE IF EXISTS enthält1;
		DROP TABLE IF EXISTS Zutaten;
		DROP TABLE IF EXISTS hat;
		DROP TABLE IF EXISTS Preise;
		DROP TABLE IF EXISTS braucht;
		DROP TABLE IF EXISTS Deklarationen;
		DROP TABLE IF EXISTS enthält;
		DROP TABLE IF EXISTS Bestellungen;
		DROP TABLE IF EXISTS gehörtZu;
		DROP TABLE IF EXISTS Fachbereiche;
		DROP TABLE IF EXISTS Kommentare;
		DROP TABLE IF EXISTS Mahlzeiten;
		DROP TABLE IF EXISTS Kategorien;
		DROP TABLE IF EXISTS	Bilder;
		DROP TABLE IF EXISTS Student;
		DROP TABLE IF EXISTS Mitarbeiter;
		DROP TABLE IF EXISTS FHAngehörige;
		DROP TABLE IF EXISTS Gäste;
		DROP TABLE IF exists Benutzer;


CREATE TABLE Benutzer (
		Nummer INT(10) UNSIGNED AUTO_INCREMENT,											-- soll im Datensatz automatisches hochzählen
		Vorname VARCHAR(30) NOT NULL,															-- nicht optionale Attribute dürfen keine Null Werte erlauben
		Nachname VARCHAR(30) NOT NULL,														 
		PRIMARY KEY(Nummer),																		-- Primärschlüssel
		Nutzername VARCHAR(100) UNIQUE,														-- müssen eindeutige Werte aufweisen
		Email VARCHAR(255) UNIQUE,
		AnlegeDatum DATE NOT NULL DEFAULT CURRENT_DATE,
		Aktiv TINYINT(1) NOT NULL DEFAULT '0',												-- Bedingung überprüfen
		CHECK (Aktiv < 2), 
		Geburtsdatum DATE,
		LetzterLogin DATETIME,																	-- optionales Attribut darf Nullwerte erlauben
		`Alter` INT(3) UNSIGNED AS (DATEDIFF(CURRENT_DATE,Geburtsdatum)/365),	-- rechnet Alter mit Funktion aus
		Salt VARCHAR(32),																			-- salt und hash als strukturiertes Attribut Auth --> kontrolliert welcher User sich
		`HASH` VARCHAR(24)																		-- anmelden darf - Authentifizierung
);


CREATE TABLE Gäste(																				-- GENERALISIERUNG
		Nummer INT(10) UNSIGNED,
		PRIMARY KEY(Nummer),																		
		Grund TEXT,
		Ablaufdatum DATE NOT NULL,
		FOREIGN KEY(Nummer) REFERENCES Benutzer(Nummer) ON DELETE CASCADE			-- Referenz zu Benutzer Tabelle
);


CREATE TABLE Bilder(
		ID INT(10) UNSIGNED AUTO_INCREMENT,
		PRIMARY KEY(ID),
		Alttext VARCHAR(20) NOT NULL,
		Titel VARCHAR(20),
		`Binaerdaten` MEDIUMBLOB -- NOT NULL												-- Binary Large Object, Meidum damit auch größere Dateiformate geladen werden
);


CREATE TABLE FHAngehörige(																		-- GENERALISIERUNG	
		Nummer INT(10) UNSIGNED,
		PRIMARY KEY(Nummer),																		
		FOREIGN KEY(Nummer) REFERENCES Benutzer(Nummer) ON DELETE CASCADE			-- Referenz zu Benutzer Tabelle
);

CREATE TABLE Mitarbeiter(																		-- SPEZIALISIERUNG
		Nummer INT(10) UNSIGNED,
		PRIMARY KEY(Nummer),																		
		FOREIGN KEY(Nummer) REFERENCES Benutzer(Nummer)ON DELETE CASCADE,			-- Verweis auf Benutzer Tabelle
		Büro VARCHAR(50),
		Telefon INT(13) UNSIGNED
);

CREATE TABLE Student(																			-- SPEZIALISIERUNG
		Nummer INT(10) UNSIGNED,
		PRIMARY KEY(Nummer),																		
		FOREIGN KEY(Nummer) REFERENCES Benutzer(Nummer) ON DELETE CASCADE,		-- Verweis auf Benutzer Tabelle
		Studiengang VARCHAR(4) NOT NULL,														-- darf nur ET, INT, ISE, MCD, WI sein
		Matrikelnummer INT(9) UNSIGNED NOT NULL,											-- darf höchstens 9 Zeichen haben
		CHECK(LENGTH(Matrikelnummer) > 7)													-- muss mindestens 7 Zeichen haben
);


CREATE TABLE Kategorien(
		ID INT(10) UNSIGNED AUTO_INCREMENT,
		Kategorien_hat INT(5) UNSIGNED,
		Kategorien_rek_hat INT(5) UNSIGNED,
		PRIMARY KEY(ID),
		Bezeichnung VARCHAR(50) NOT NULL,
		FOREIGN KEY (Kategorien_hat) REFERENCES Bilder(ID) ON DELETE SET NULL,				-- Verweis auf 1 : N Beziehung - Ein Bild hat viele Kategorien
		FOREIGN KEY (Kategorien_rek_hat) REFERENCES Kategorien(ID) ON DELETE SET NULL		-- Verweis auf gleiche Tabelle 1: N Beziehung - Eine Kategorie hat viele Unterkategorien
);


CREATE TABLE Mahlzeiten(
		`Name` TEXT,																							-- für einzelne Kategorien unter Details
		ID INT(10)	 UNSIGNED AUTO_INCREMENT,
		PRIMARY KEY(ID),
		Kategorie_in INT(5) UNSIGNED,
		Beschreibung TEXT NOT NULL,
		Verfügbar TINYINT(1),
		CHECK (Verfügbar < 2),
		Vorrat INT(5) UNSIGNED NOT NULL,
		FOREIGN KEY (Kategorie_in) REFERENCES Kategorien(ID) ON DELETE CASCADE				-- 1 : N Beziehung - eine Kategorie hat viele Mahlzeiten
);


CREATE TABLE Kommentare(
		ID INT(10) UNSIGNED AUTO_INCREMENT,
		KommentarSchreibt INT(10) UNSIGNED,
		SchreibtZuM INT(10) UNSIGNED,
		PRIMARY KEY(ID),
		Bemerkung TEXT,
		Bewertung TINYINT(1) NOT NULL,
		CHECK (Bewertung <6),																		-- Bewertungen von 1 bis 5 möglich
		FOREIGN KEY (KommentarSchreibt) REFERENCES Student(Nummer),						-- Verweis auf 1 : N Beziehung - Ein Student kann viele Kommentare schreiben
		FOREIGN KEY (SchreibtZuM) REFERENCES Mahlzeiten(ID) ON DELETE SET NULL		-- Verweis auf 1 : N Beziehung - Viele Kommentare zu einer Mahlzeit

);


CREATE TABLE Fachbereiche(
		ID INT(10) UNSIGNED AUTO_INCREMENT,
		PRIMARY KEY(ID),
		Website VARCHAR(50) NOT NULL,
		`Name` VARCHAR(30) NOT NULL,
		`Adresse` VARCHAR(500) NOT NULL
);


CREATE TABLE gehörtZU(																				-- Kreuztabelle für N : M Beziehung - viele Fachbereiche haben viele FH Angehörige
		FHzuFach INT(10) UNSIGNED,
		FachzuFH INT(10) UNSIGNED,
		
		FOREIGN KEY(FachzuFH) REFERENCES Fachbereiche(ID),
		FOREIGN KEY(FHzuFach) REFERENCES FHAngehörige(Nummer)

);


CREATE TABLE Bestellungen(
		Nummer INT(10) UNSIGNED AUTO_INCREMENT,
		PRIMARY KEY(Nummer),
		Abholzeitpunkt TIME,																			-- Abholzeitpunkt > Bestellzeitpunkt!
		Bestellzeitpunkt TIME NOT NULL,
		Endpreis DECIMAL(4,2),																		-- Preise nicht über 99,99 Euro
		Benutzer_Nummer INT(5) UNSIGNED,
		FOREIGN KEY (Benutzer_Nummer) REFERENCES Benutzer(Nummer)						-- 1: N Beziehung - ein Benutzer tätigt viele Bestellungen
);


CREATE TABLE enthält(																				-- N : M Beziehung - viele Bestellegungen enthalten viele Mahlzeiten
		MahlzeitID INT(5) UNSIGNED,
		BestellungID INT(5) UNSIGNED,
		Anzahl INT(5) UNSIGNED,
		PRIMARY KEY (MahlzeitID,BestellungID),
		FOREIGN KEY (BestellungID) REFERENCES Bestellungen(Nummer),
		FOREIGN KEY (MahlzeitID) REFERENCES Mahlzeiten(ID)
);


CREATE TABLE Deklarationen(
		Zeichen VARCHAR(2),
		PRIMARY KEY (Zeichen),
		Beschriftung TEXT NOT NULL
);


CREATE TABLE braucht(																				-- N : M Bzeiheung - viele Mahlzeiten brauchen viele Deklarationen
		DekBrauchtMahl VARCHAR(2),
		MahlBrauchtDek INT(5) UNSIGNED AUTO_INCREMENT,
		PRIMARY KEY (DekBrauchtMahl, MahlBrauchtDek),
		FOREIGN KEY (DekBrauchtMahl) REFERENCES Deklarationen (Zeichen),
		FOREIGN KEY (MahlBrauchtDek) REFERENCES Mahlzeiten(ID)
);


CREATE TABLE Preise(
		Jahr YEAR(4) UNSIGNED NOT NULL,								
		MahlzeitenID INT(5) UNSIGNED,
		Gastpreis DECIMAL(4,2) NOT NULL,															-- Gastpreis gilt, wenn keine Vergünstigung > Studentenpreis/ MA- Preis
		Studentpreis DECIMAL(4,2),																	-- optionale Attribute dürfen Nullwerte erlauben
		MAPreis DECIMAL(4,2),																		-- darf 99,99 nicht übersteigen
		FOREIGN KEY(MahlzeitenID) REFERENCES Mahlzeiten(ID) ON DELETE CASCADE,		-- 1:1 Beziehung - eine Mahlzeit hat einen Preis
		PRIMARY KEY (MahlzeitenID, Jahr)
);



CREATE TABLE hat(																						-- Kreuztabelle N : M - viele Mahlzeiten haben viele Bilder
		BilderID INT(5) UNSIGNED AUTO_INCREMENT,
		MahlzeitenID INT(5) UNSIGNED,
		PRIMARY KEY (BilderID,MahlzeitenID),													-- PK optional - Designfrage
		FOREIGN KEY (BilderID) REFERENCES Mahlzeiten(ID),
		FOREIGN KEY (MahlzeitenID) REFERENCES Bilder(ID)
);


CREATE TABLE Zutaten(																				-- alle Attribute sind FLags also erlauben nur 0 oder 1
		ID INT(5) UNSIGNED,
		PRIMARY KEY(ID),
		`Name` VARCHAR(20) NOT NULL,
		Bio TINYINT(1) NOT NULL,
		CHECK (Bio < 2),
		Vegetarisch TINYINT(1) NOT NULL,
		CHECK (Vegetarisch < 2),
		Vegan TINYINT(1) NOT NULL,
		CHECK (Vegan < 2),
		Glutenfrei TINYINT(1) NOT NULL,
		CHECK (Glutenfrei < 2)
);


CREATE TABLE enthält1(																				-- N : M Beziehung - viele Mahlzeiten enthalten viele Zutaten
	MahlzeitID INT(5) UNSIGNED AUTO_INCREMENT,
	ZutatID INT(5) UNSIGNED,
	PRIMARY KEY (MahlzeitID,ZutatID),
	FOREIGN KEY (MahlzeitID) REFERENCES Mahlzeiten(ID) ON DELETE CASCADE,
	FOREIGN KEY (ZutatID) REFERENCES Zutaten(ID)

);


CREATE TABLE befreundetMit(																	-- Kreuztabelle referenziert mit FKs jeweils auf Benutzer --> N : M Relation
		Freund1 INT(4) UNSIGNED AUTO_INCREMENT,											
		Freund2 INT(4) UNSIGNED,
		PRIMARY KEY (Freund1,Freund2),
		FOREIGN KEY (Freund1) REFERENCES Benutzer(Nummer),
		FOREIGN KEY (Freund2) REFERENCES Benutzer(Nummer)
);


